                    useLegacyClips = true
                }
            };
        }

        private void Update()
        {
            if (
                glbSampleName == null || 
                !Input.GetKeyDown(KeyCode.T) || !Input.GetKey(KeyCode.LeftShift)) return;

            AnimationClip[] animations;
            try
            {
                var result = Importer.LoadFromFile("Assets/Resources/Test/" + glbSampleName, importSettings,
                    out animations);
                result.name = glbSampleName;
                result.transform.position = Player.INSTANCE.GetPosition() + 10 * Vector3.up;
                Debug.Log("Glb imported");

                if (animations.Length > 0)
                {
                    result.AddComponent<Animation>();
                    var anim = result.GetComponent<Animation>();
                    anim.playAutomatically = false;
                    anim.clip = animations[0];
                    anim.AddClip(anim.clip, anim.clip.name);
                    anim.Play(anim.clip.name);
                }
            }
            catch
            {
                Debug.LogError("Failed to import glb from file");
